import androidx.lifecycle.ViewModel
import androidx.lifecycle.viewModelScope
import kotlinx.coroutines.Job
import kotlinx.coroutines.delay
import kotlinx.coroutines.flow.MutableStateFlow
import kotlinx.coroutines.flow.StateFlow
import kotlinx.coroutines.flow.asStateFlow
import kotlinx.coroutines.launch
import kotlin.random.Random

class GameViewModel : ViewModel() {
    private val _gameState = MutableStateFlow(GameState(board = emptyList()))
    val gameState: StateFlow<GameState> = _gameState.asStateFlow()

    private var timerJob: Job? = null

    init {
        startNewGame(GameLevel.EASY)
    }

    fun startNewGame(level: GameLevel) {
        timerJob?.cancel()
        val board = generateBoard(level)
        _gameState.value = GameState(
            board = board,
            level = level,
            score = 0,
            timeElapsed = 0,
            isGameOver = false,
            isGameWon = false,
            isPaused = false,
            selectedTiles = emptyList()
        )
        startTimer()
    }

    private fun generateBoard(level: GameLevel): List<List<GameTile?>> {
        val totalTiles = level.rows * level.cols
        val pairsNeeded = totalTiles / 2
        val availableTypes = TileType.values().take(level.tileTypes)

        // Generate pairs of tiles
        val tiles = mutableListOf<GameTile>()
        var id = 0

        repeat(pairsNeeded / availableTypes.size + 1) {
            availableTypes.forEach { type ->
                if (tiles.size < totalTiles) {
                    repeat(2) {
                        if (tiles.size < totalTiles) {
                            tiles.add(GameTile(id++, type, 0, 0))
                        }
                    }
                }
            }
        }

        // Shuffle tiles
        tiles.shuffle(Random.Default)

        // Create board
        val board = mutableListOf<MutableList<GameTile?>>()
        var tileIndex = 0

        for (row in 0 until level.rows) {
            val rowList = mutableListOf<GameTile?>()
            for (col in 0 until level.cols) {
                if (tileIndex < tiles.size) {
                    val tile = tiles[tileIndex].copy(row = row, col = col)
                    rowList.add(tile)
                    tileIndex++
                } else {
                    rowList.add(null)
                }
            }
            board.add(rowList)
        }

        return board
    }

    fun onTileClicked(tile: GameTile) {
        val currentState = _gameState.value
        if (currentState.isPaused || currentState.isGameOver || currentState.isGameWon || !tile.isVisible) {
            return
        }

        val selectedTiles = currentState.selectedTiles.toMutableList()

        when {
            tile.isSelected -> {
                // Deselect tile
                selectedTiles.remove(tile)
                updateTileSelection(tile, false)
            }
            selectedTiles.size < 2 -> {
                // Select tile
                selectedTiles.add(tile)
                updateTileSelection(tile, true)
            }
            else -> {
                // Replace selection
                selectedTiles.forEach { updateTileSelection(it, false) }
                selectedTiles.clear()
                selectedTiles.add(tile)
                updateTileSelection(tile, true)
            }
        }

        _gameState.value = currentState.copy(selectedTiles = selectedTiles)

        // Check for match if two tiles are selected
        if (selectedTiles.size == 2) {
            checkForMatch(selectedTiles[0], selectedTiles[1])
        }
    }

    private fun updateTileSelection(tile: GameTile, isSelected: Boolean) {
        val currentBoard = _gameState.value.board.map { row ->
            row.map { boardTile ->
                if (boardTile?.id == tile.id) {
                    boardTile.copy(isSelected = isSelected)
                } else {
                    boardTile
                }
            }
        }
        _gameState.value = _gameState.value.copy(board = currentBoard)
    }

    private fun checkForMatch(tile1: GameTile, tile2: GameTile) {
        viewModelScope.launch {
            delay(500) // Show selection briefly

            if (tile1.type == tile2.type && canConnect(tile1, tile2)) {
                // Match found
                removeTiles(tile1, tile2)
                val newScore = _gameState.value.score + 100
                _gameState.value = _gameState.value.copy(
                    score = newScore,
                    selectedTiles = emptyList()
                )

                // Check if game is won
                if (isGameComplete()) {
                    _gameState.value = _gameState.value.copy(isGameWon = true)
                    timerJob?.cancel()
                }
            } else {
                // No match, deselect tiles
                updateTileSelection(tile1, false)
                updateTileSelection(tile2, false)
                _gameState.value = _gameState.value.copy(selectedTiles = emptyList())
            }
        }
    }

    private fun canConnect(tile1: GameTile, tile2: GameTile): Boolean {
        // Simplified connection logic - in a real game, this would check for valid paths
        // For now, we'll allow any two matching tiles to connect
        return true
    }

    private fun removeTiles(tile1: GameTile, tile2: GameTile) {
        val currentBoard = _gameState.value.board.map { row ->
            row.map { boardTile ->
                when {
                    boardTile?.id == tile1.id || boardTile?.id == tile2.id -> null
                    else -> boardTile
                }
            }
        }
        _gameState.value = _gameState.value.copy(board = currentBoard)
    }

    private fun isGameComplete(): Boolean {
        return _gameState.value.board.all { row ->
            row.all { tile -> tile == null }
        }
    }

    private fun startTimer() {
        timerJob = viewModelScope.launch {
            while (!_gameState.value.isGameOver && !_gameState.value.isGameWon) {
                if (!_gameState.value.isPaused) {
                    delay(1000)
                    _gameState.value = _gameState.value.copy(
                        timeElapsed = _gameState.value.timeElapsed + 1
                    )
                } else {
                    delay(100)
                }
            }
        }
    }

    fun pauseGame() {
        _gameState.value = _gameState.value.copy(isPaused = true)
    }

    fun resumeGame() {
        _gameState.value = _gameState.value.copy(isPaused = false)
    }

    fun restartGame() {
        startNewGame(_gameState.value.level)
    }

    override fun onCleared() {
        super.onCleared()
        timerJob?.cancel()
    }
}"}

