import androidx.lifecycle.viewmodel.compose.viewModel

@OptIn(ExperimentalMaterial3Api::class)
@Composable
fun GameScreen(viewModel: GameViewModel = viewModel()) {
    val gameState by viewModel.gameState.collectAsState()

    Column(
        modifier = Modifier
            .fillMaxSize()
            .background(MaterialTheme.colorScheme.background)
            .padding(16.dp)
    ) {
        // Top bar with score and time
        TopAppBar(
            title = {
                Text(
                    text = "连连看",
                    style = MaterialTheme.typography.headlineMedium,
                    fontWeight = FontWeight.Bold
                )
            },
            actions = {
                Column(horizontalAlignment = Alignment.End) {
                    Text(
                        text = "分数: ${gameState.score}",
                        style = MaterialTheme.typography.bodyMedium,
                        fontWeight = FontWeight.Medium
                    )
                    Text(
                        text = "时间: ${formatTime(gameState.timeElapsed)}",
                        style = MaterialTheme.typography.bodyMedium,
                        fontWeight = FontWeight.Medium
                    )
                }
            },
            colors = TopAppBarDefaults.topAppBarColors(
                containerColor = MaterialTheme.colorScheme.primaryContainer
            )
        )

        Spacer(modifier = Modifier.height(16.dp))

        // Control buttons
        Row(
            modifier = Modifier.fillMaxWidth(),
            horizontalArrangement = Arrangement.SpaceEvenly
        ) {
            Button(
                onClick = { viewModel.startNewGame(GameLevel.EASY) },
                colors = ButtonDefaults.buttonColors(
                    containerColor = MaterialTheme.colorScheme.primary
                )
            ) {
                Text("简单")
            }

            Button(
                onClick = { viewModel.startNewGame(GameLevel.MEDIUM) },
                colors = ButtonDefaults.buttonColors(
                    containerColor = MaterialTheme.colorScheme.secondary
                )
            ) {
                Text("中等")
            }

            Button(
                onClick = { viewModel.startNewGame(GameLevel.HARD) },
                colors = ButtonDefaults.buttonColors(
                    containerColor = MaterialTheme.colorScheme.tertiary
                )
            ) {
                Text("困难")
            }
        }

        Spacer(modifier = Modifier.height(8.dp))

        Row(
            modifier = Modifier.fillMaxWidth(),
            horizontalArrangement = Arrangement.SpaceEvenly
        ) {
            Button(
                onClick = { 
                    if (gameState.isPaused) {
                        viewModel.resumeGame()
                    } else {
                        viewModel.pauseGame()
                    }
                },
                colors = ButtonDefaults.buttonColors(
                    containerColor = MaterialTheme.colorScheme.outline
                )
            ) {
                Text(if (gameState.isPaused) "继续" else "暂停")
            }

            Button(
                onClick = { viewModel.restartGame() },
                colors = ButtonDefaults.buttonColors(
                    containerColor = MaterialTheme.colorScheme.error
                )
            ) {
                Text("重新开始")
            }
        }

        Spacer(modifier = Modifier.height(16.dp))

        // Game board
        Box(
            modifier = Modifier
                .fillMaxWidth()
                .weight(1f),
            contentAlignment = Alignment.Center
        ) {
            if (gameState.board.isNotEmpty()) {
                GameBoard(
                    gameState = gameState,
                    onTileClick = { tile -> viewModel.onTileClicked(tile) }
                )
            }

            // Overlay for pause, game over, or game won
            when {
                gameState.isPaused -> {
                    Card(
                        modifier = Modifier.padding(32.dp),
                        colors = CardDefaults.cardColors(
                            containerColor = MaterialTheme.colorScheme.surface.copy(alpha = 0.95f)
                        )
                    ) {
                        Column(
                            modifier = Modifier.padding(24.dp),
                            horizontalAlignment = Alignment.CenterHorizontally
                        ) {
                            Text(
                                text = "游戏暂停",
                                style = MaterialTheme.typography.headlineMedium,
                                fontWeight = FontWeight.Bold
                            )
                            Spacer(modifier = Modifier.height(16.dp))
                            Button(onClick = { viewModel.resumeGame() }) {
                                Text("继续游戏")
                            }
                        }
                    }
                }

                gameState.isGameWon -> {
                    Card(
                        modifier = Modifier.padding(32.dp),
                        colors = CardDefaults.cardColors(
                            containerColor = MaterialTheme.colorScheme.primaryContainer
                        )
                    ) {
                        Column(
                            modifier = Modifier.padding(24.dp),
                            horizontalAlignment = Alignment.CenterHorizontally
                        ) {
                            Text(
                                text = "🎉 恭喜过关！",
                                style = MaterialTheme.typography.headlineMedium,
                                fontWeight = FontWeight.Bold
                            )
                            Spacer(modifier = Modifier.height(8.dp))
                            Text(
                                text = "最终分数: ${gameState.score}",
                                style = MaterialTheme.typography.bodyLarge
                            )
                            Text(
                                text = "用时: ${formatTime(gameState.timeElapsed)}",
                                style = MaterialTheme.typography.bodyLarge
                            )
                            Spacer(modifier = Modifier.height(16.dp))
                            Button(onClick = { viewModel.restartGame() }) {
                                Text("再玩一次")
                            }
                        }
                    }
                }
            }
        }
    }
}

@Composable
fun GameBoard(
    gameState: GameState,
    onTileClick: (GameTile) -> Unit
) {
    val level = gameState.level

    LazyVerticalGrid(
        columns = GridCells.Fixed(level.cols),
        contentPadding = PaddingValues(4.dp),
        horizontalArrangement = Arrangement.spacedBy(2.dp),
        verticalArrangement = Arrangement.spacedBy(2.dp),
        modifier = Modifier.fillMaxSize()
    ) {
        items(gameState.board.flatten()) { tile ->
            TileItem(
                tile = tile,
                onClick = { tile?.let { onTileClick(it) } }
            )
        }
    }
}

@Composable
fun TileItem(
    tile: GameTile?,
    onClick: () -> Unit
) {
    Box(
        modifier = Modifier
            .aspectRatio(1f)
            .clip(RoundedCornerShape(8.dp))
            .background(
                when {
                    tile == null -> Color.Transparent
                    tile.isSelected -> MaterialTheme.colorScheme.primary.copy(alpha = 0.3f)
                    else -> MaterialTheme.colorScheme.surface
                }
            )
            .border(
                width = if (tile?.isSelected == true) 3.dp else 1.dp,
                color = if (tile?.isSelected == true) 
                    MaterialTheme.colorScheme.primary 
                else 
                    MaterialTheme.colorScheme.outline.copy(alpha = 0.3f),
                shape = RoundedCornerShape(8.dp)
            )
            .clickable(enabled = tile != null) { onClick() },
        contentAlignment = Alignment.Center
    ) {
        tile?.let {
            Text(
                text = it.type.symbol,
                fontSize = 24.sp,
                color = it.type.color,
                textAlign = TextAlign.Center,
                fontWeight = FontWeight.Bold
            )
        }
    }
}

private fun formatTime(seconds: Long): String {
    val minutes = seconds / 60
    val remainingSeconds = seconds % 60
    return String.format("%02d:%02d", minutes, remainingSeconds)
}"}

